import './App.css';
import { useState } from 'react'

const [history, setHistory] = useState('')

function App() {
  return (
    <>
      <History />
      <input />
    </>
  )
}

function History() {
  return (
    <ul>
      {history}
    </ul>
  )
}

export default App;
